			shellScript = "#!/bin/sh\n \n # 打包SDK\n # 资源文件bundle名字 警告！！！！！！需要修改\n SF_TARGET_NAME=\"quysAdvice\"\n #自定义的用来存放最后合并的framework\n UNIVERSAL_OUTPUTFOLDER=${BUILD_DIR}/${CONFIGURATION}-universal-$(date \"+%Y-%m-%d %H:%M:%S\")\n #IPHONE_DEVICE_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphoneos\n WORKSPACE_NAME=${PROJECT_NAME}.xcworkspace\n YO_SCHEME=${PROJECT_NAME}\n xcodebuild -workspace ${WORKSPACE_NAME} -scheme ${YO_SCHEME} -sdk iphonesimulator -configuration \"${CONFIGURATION}\"\n xcodebuild -workspace ${WORKSPACE_NAME} -scheme ${YO_SCHEME} -sdk iphoneos -configuration \"${CONFIGURATION}\"\n # 因为framework的合并,lipo只是合并了最后的 二进制可执行文件,所以其它的需要我们自己复制过来\n rm -rf \"${UNIVERSAL_OUTPUTFOLDER}\"\n mkdir -p \"${UNIVERSAL_OUTPUTFOLDER}\"\n cp -R \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}.framework\" \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\"\n # 合并模拟器和真机的架构\n #lipo -create \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${PROJECT_NAME}.framework/${PROJECT_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${PROJECT_NAME}.framework/${PROJECT_NAME}\" -output \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/${PROJECT_NAME}\"\n #真机\n   lipo -create \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${PROJECT_NAME}.framework/${PROJECT_NAME}\" -output \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework/${PROJECT_NAME}\"\n\n #open \"${UNIVERSAL_OUTPUTFOLDER}\"\n#打包SDK结束\n \n \n \n #打包bundle\n # 工程文件所在的根目录\n SRCROOT='.'\n # sdk 编译过程的输出文件路径\n WRK_DIR=./build\n # 创建 sdk 输出路径\n #mkdir -p ${SRCROOT}/Products\n # 资源文件bundle名字 警告！！！！！！需要修改\n BUNDLE_NAME='quysBundle'\n # 真机 bundle 输出文件路径\n BUNDLE_DEVICE_DIR=${WRK_DIR}/${CONFIGURATION}-iphoneos/${BUNDLE_NAME}.bundle\n # 模拟器 bundle 输出文件路径\n BUNDLE_SIMULATOR_DIR=${WRK_DIR}/${CONFIGURATION}-iphonesimulator/${BUNDLE_NAME}.bundle\n # 编译资源文件bundle\n xcodebuild -configuration \"${CONFIGURATION}\" -target \"${BUNDLE_NAME}\" -sdk iphoneos build -UseModernBuildSystem=NO\n xcodebuild -configuration \"${CONFIGURATION}\" -target \"${BUNDLE_NAME}\" -sdk iphonesimulator  build -UseModernBuildSystem=NO\n  \n # 最终 资源文件 输出的文件路径\n BUNDLE_INSTALL_DIR=${UNIVERSAL_OUTPUTFOLDER}/${BUNDLE_NAME}.bundle\n # 清理之前生成的 sdk\n if [ -d \"${BUNDLE_INSTALL_DIR}\" ]\n then\n rm -rf \"${BUNDLE_INSTALL_DIR}\"\n fi\n # 移动一个 budle 到 资源文件输出路径中\n cp -LR \"${BUNDLE_DEVICE_DIR}\" \"${BUNDLE_INSTALL_DIR}\"\n  \n # 合并真机和模拟器的资源文件bundle\n #lipo -create \"${BUNDLE_DEVICE_DIR}/${BUNDLE_NAME}\" \"${BUNDLE_SIMULATOR_DIR}/${BUNDLE_NAME}\" -output \"${BUNDLE_INSTALL_DIR}/${BUNDLE_NAME}\"\n\n#真机\nlipo -create \"${BUNDLE_DEVICE_DIR}/${BUNDLE_NAME}\"  -output \"${BUNDLE_INSTALL_DIR}/${BUNDLE_NAME}\"\n\n  \n  \n  \n  \n # 清理编译文件\n rm -r \"${WRK_DIR}\"\n  \n # 打开SDK目录\nopen \"${UNIVERSAL_OUTPUTFOLDER}\"\n";
